import React from "react";
import {
  useNavigate,
  useLocation
} from "react-router-dom";

class WeatherInfo extends React.Component {
    constructor(props) {
        super(props);
        const location = () => {useLocation(); }
        var history = () => {useNavigate(); }

        this.state = {items: []};
      }

      componentDidMount() {
        fetch(
            "https://goweather.herokuapp.com/weather/stockholm")
                        .then((res) => res.json())
                        .then((json) => {
                            this.setState({
                                items: json
                            }
                            )
                        })
      }

      componentWillUnmount() {
      }

      render() {
        return (
          <div>
            <h1>Hello, world!</h1>
            <h2>It is {location.state.name}.</h2>
          </div>
        );
}}

export default WeatherInfo;
